dox.base64 = {};

dox.base64.Data = {
	["keepcalm"] = "",
	--courtesy of https://www.formget.com/css-hr/
	["keepcalm_bloody"] = "",
	["pacman"] = "",
	["favicon"] = "",
};


--[[!
@module dox.base64
@func dox.base64.getData
@desc Returns the base64 data string for encoded files.
@param sDataIndex string The name of the table index that contains the base64 data string.
!]]
function dox.base64.getData(sDataIndex)
local sRet = "";

	if dox.base64.Data[sDataIndex] then
	sRet = dox.base64.Data[sDataIndex]
	end

return sRet
end